import { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [message, setMessage] = useState("");
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/test")
      .then((res) => res.json())
      .then((data) => {
        setMessage(data.message);
        setData(data.data);
      })
      .catch((err) => console.error("Error:", err));
  }, []);

  return (
    <div className="App">
      <h1>React + Express 연결 테스트</h1>
      <p>서버 메시지: {message}</p>
      <p>데이터: {data.join(", ")}</p>
    </div>
  );
}

export default App;
